L,'2014-04-16 22:14:39',NULL,NULL,'2014-08-13 12:20:29',11,0,NULL,NULL,NULL,201),(64,30,29,NULL,'Mailing Veranstaltungsraum',0,1,NULL,'2014-05-13','2014-05-14',186.84,NULL,NULL,628,NULL,186.84,'2014-04-17 12:32:49',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,200),(65,43,33,NULL,'Gudd Gess',0,0,'http://www.gudd-gess.de/start/gastro/ratskeller/','2014-01-01','2014-12-31',1,NULL,NULL,NULL,NULL,NULL,'2014-04-17 12:43:08',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,200),(66,44,29,NULL,'Bio Brotbox Mannheim',0,0,'Von: Achim Scheifl - Seufert & Diemer (Versicherungsmakler) [mailto:a.scheifl@seufert-diemer.de] \r\nGesendet: Donnerstag, 10. April 2014 08:47\r\nAn: Robert Nürnberger\r\nBetreff: Bio Brotbox Mannheim\r\n \r\nHallo Robby, \r\n \r\nanbei sende ich dir noch die versprochene Info zu der Bio-Brotbox, die für die diesjährigen Erstklässler in Mannheim geplant ist und um Spender wirbt. Stückzahl ca. 1400 Boxen. Werden im September verteilt.\r\nAnbei auch einen Link zu einem youtube Beitrag über die Aktion in Berlin. Das sollte doch in Mannehim auch zu schaffen sein... :)\r\n \r\nhttp://youtu.be/7z5hZLFKvEw\r\n \r\nSchaus dir bitte mal an und lass uns quatschen :o)\r\n \r\nLG\r\n \r\nAchim\r\n \r\n \r\n \r\n----- Original Message ----- \r\nFrom: Petra Leinberger \r\nTo: Scheifl, Achim \r\nSent: Wednesday, March 19, 2014 12:44 PM\r\nSubject: Bio Brotbox Mannheim\r\n \r\nHallo Herr Scheifl,\r\nhier noch einmal kurz zusammengefasst Infos zur Bio Brotbox Mannheim.\r\n \r\nWir haben im vergangenen Jahr die Bio Brotbox-Initiative nach Mannheim \"getragen\" und zunächst im kleinen Rahmen (um uns \"warmzulaufen\") mit einer Schule , der Pestalozzischule, begonnen.\r\nEs lief so gut, dass wir uns nun für 2014 zutrauen, allen interessierten Mannheimer Grundschulen die Bio-Brotbox zukommen zu lassen.\r\nKürzlich hatten wir ein Netzwerk-Treffen einiger beteiligter Städte, bei dem wir unsere Erfahrungen austauschen und uns gegenseitig hilfreiche Tipps geben konnten.\r\nDie Initiativen einiger Städte sind schon seit vielen Jahren dabei und werden bei der Bio Brotbox auch durch viele regionale Unternehmen unterstützt.\r\nWarum sollte das nicht auch in Mannheim funktionieren?\r\nWir sprechen zur Zeit alle  Mannheimer Grundschulen an, um die Bio Brotbox anzubieten - natürlich würden wir uns sehr freuen, dabei von vielen MannheimerInnen unterstützt zu werden.\r\nWas wir noch dringend benötigen, sind \"Promi-Paten\", einen Logistiker,bei dem wir die Produkte anliefern,lagern und packen können und der bei der Verteilung/dem Ausfahren hilft, Menschen, die beim Packen und Verteilen helfen und Firmen, die mit Geld zur Beschaffung der leeren Boxen helfen möchten (das müssen keine riesigen Beträge sein,wenn wir  ein paar Unternehmen finden, die 100 bis 200 EUR spenden, haben wir die Boxen ja schon nahezu zusammen, der Preis pro Box lag im vergangenen Jahr bei EUR 0,57 zzgl. MwSt.- eine Spendenquittung ist über die Netzwerkorganisation möglich ).\r\nKreative Leute, die uns bei der Flyererstellung oder sonstwie beim Publizieren der Aktion unterstützen möchten, sind auch willkommen.\r\n \r\nWorum geht es bei der Bio-Brotbox?\r\nBei dieser Aktion wird Erstklässern zur Einschulung eine Brotbox mit gesunden Bio-Lebensmitteln übergeben (z.B. Möhre, Apfel,Müsliriegel,vegetarischer Brotaufstrich, Müsli, Fruchtsaft o.ä.).\r\nBei der Aktion geht es darum, früh das Thema gesunde Ernährung ins Bewusstsein zu rücken und einen Impuls für die Wichtigkeit eines täglichen gesunden Frühstücks zu geben.\r\n \r\n Grundsätzlich sind folgende 3 Ziele definiert : \r\nJedes Kind sollte täglich frühstücken\r\nJedes Kind sollte täglich gesund frühstücken\r\nJedes Kind sollte Nahrung schätzen lernen und Wissen über Herkuft und Entstehung von Lebensmitteln kennenlernen.\r\nDie Aktion bietet also auch den Lehrern/Lehrerinnen die Möglichkeit, mit diesem \"Aufhänger\" eine altersgerechte Auseinandersetzung mit diesem Thema im Unterricht zu implementieren.\r\n \r\nWeitere Info finden Sie auch unter:\r\nwww.bio-brotbox.de oder auf unserer Mannheimer Bio-Brotbox-Website: www.biobrotbox-mannheim.de\r\n \r\nIch sende Ihnen auch einmal die Presseerklärung der Netzwerkorganisation über die Initiativen 2013.\r\nVielleicht haben Sie ja eine Idee und Interesse, uns beim weiteren Aufbau der Aktion in Mannheim zu unterstützen - ich würde mich sehr freuen!\r\n \r\nBei der Akquise von Sponsoren, die die Boxen befüllen, waren wir schon recht erfolgreich und werden Gaben von Alnatura, PEMA, Spielberger Mühle, Reformhaus Escher, WILLMANN PAX AN , Provamel\r\nund anderen erhalten.\r\n.\r\nHerzliche Grüße\r\n \r\n \r\nPetra Leinberger\r\n \r\nCheckpoint Marktforschung\r\nTraitteurstr. 28 - 34\r\n68165 Mannheim\r\nTel 0621 - 49 49 480 - 20\r\nFax 0621 - 49 49 480 - 28\r\nwww.checkpoint-mafo.com\r\n \r\nGründer der Initiative Bio-Brotbox Mannheim\r\nwww.biobrotbox-mannheim.de\r\n \r\nPLEASE: THINK BEFORE YOU PRINT!','2014-06-01','2014-06-01',1,NULL,NULL,NULL,NULL,NULL,'2014-04-17 13:06:53',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,200),(67,10,38,5,'Titelseite WOB',0,0,'Hi Markus,\r\n\r\nAuf der Titelseite für den 23. April ist im  Leitartikel  ein Platzierung in der Größe 2/150 frei\r\nPreis laut Liste 1083.-€ , frech wie ich bin  biete ich den für 390.-€ netto an.\r\nDas Format ist 87mm Breite- 150mm Höhe . Bitte gib mir bei Interesse über die Feiertage Bescheid, die Vorlage brauch ich am Dienstag spätestens um 12Uhr ( bitte, bitte nicht später)\r\n\r\n\r\nLG und frohe Ostern','2014-04-23','2014-04-23',390,1,NULL,135000,NULL,1083,'2014-04-18 10:36:11',NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,200),(68,45,23,NULL,'Anzeige Ludwigsburger Wochenblatt - Biergarteneröffnung',0,0,'Guten Morgen.\r\n\r\n\r\nDie 1/3-Seite ist 324 x 160mm oder 180 x 280mm und die halbe Seite ist 324 x 240mm!  \r\n\r\nMit freundlichem Gruß \r\n\r\nVolker Hildner.\r\n \r\nLudwigsburger Wochenblatt GmbH + Co. KG. \r\nLindenstraße 15. \r\n71634 Ludwigsburg. \r\nTelefon (07141) 96 20-515. \r\nTelefax (07141) 96 20- 10 515