  `nightlounge` date DEFAULT NULL,
  `fajitaDay` date DEFAULT NULL,
  `cooperationType` int(11) DEFAULT NULL,
  `note` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `discountInfo` longtext COLLATE utf8_unicode_ci,
  `internetPermission` tinyint(1) NOT NULL,
  `city_id` int(11) DEFAULT NULL,
  `invoicesToBeon` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `IDX_784FEC5F727ACA70` (`parent_id`),
  KEY `IDX_784FEC5F8BAC62AF` (`city_id`),
