  CONSTRAINT `FK_784FEC5F2F0BA6F1` FOREIGN KEY (`cooperationType`) REFERENCES `EnumValue` (`id`),
  CONSTRAINT `FK_784FEC5F727ACA70` FOREIGN KEY (`parent_id`) REFERENCES `Customer` (`id`) ON DELETE SET NULL,
  CONSTRAINT `FK_784FEC5F8BAC62AF` FOREIGN KEY (`city_id`) REFERENCES `City` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
