INSERT INTO `Note` VALUES (10,17,'Display Gambas für September 2014','2014-04-13 14:46:46',NULL,NULL,NULL,NULL,0,11),(15,20,'Sommerfest am Pfingstmontag, 06. Juni 2014 ab 12 Uhr\r\n- Grill\r\n- Bierbänke, -tische,\r\n- Kinderschminken, Dosenwerfen\r\n- Bier aus dem Holzfass, Preis?\r\n- Cocktails zum Special-Preis\r\n- PM erstellen\r\n- Flyer (Rückseite Aktionen)','2014-04-13 16:10:48',NULL,NULL,NULL,NULL,0,11),(17,20,'mysterial table - Infos kommen von Daniel G','2014-04-13 17:06:55',NULL,NULL,NULL,NULL,0,11),(18,21,'Raucher-Lounge. Zur Info: Die Lounge wird an Nicht-Öffnungstagen als Raucherlounge genutzt.','2014-04-13 17:14:06',NULL,NULL,NULL,NULL,0,11),(19,25,'Enchilada Sommerfest\r\nPfingstsonntag, ab 15 Uhr\r\nAußenbar mit Sommer-Caipis für 3,90 Euro\r\nHüpfburg für Kinder, Kinderschminken, Pool, Luftballons\r\nKontakt zu Grill mailen wegen Abholung (Adresse, Datum, Uhrzeit)\r\nGrill: Steaks. Spareribs, Bratwurst, Beilagen\r\n\r\nFlyer: A6 - 5.000\r\nPlakate: A3 - 100\r\nPM\r\nAnzeige: Showtime Mai, Frizz im Juni\r\n\r\nFrizz-Mai-Cocktail-Casino erl\r\n\r\nMagarita of the week \r\nIdeen zu Voting machen\r\n\r\nSteckbrief Mitarbeiter\r\n- Foto von Mitarbeiter kommen von Markus\r\n\r\nEnchi-Hour Flyer - 5000 STück, DINlang\r\nnachfassen\r\n\r\nPyramamiden - nachfassen\r\n\r\n\r\nHüpfburg - Markus\r\nPool - Melli\r\nPressetext Simone\r\n\r\nParkhaus (Werbung, Parktickets, ... ) Markus\r\nWKZ für Sommerfest (Brauerei, Alk, ... ) Markus','2014-04-14 11:28:30',NULL,NULL,NULL,NULL,0,11),(20,29,'Magarita of the week\r\n1000 Aufsteller - Magarita\r\nBei Jule in Auftrag gegeben, 140414\r\n\r\n5.000 Cocktail Casino 2. Chance\r\nBei Jule in Auftrag gegeben, 140414\r\n\r\nnächster Termin:\r\nWürfel statt Bon´s\r\nBio Brotbox Mannheim\r\nTequila - eventuell im Herbst','2014-04-14 16:21:16',NULL,NULL,NULL,NULL,0,11),(21,127,'15 Jahre Enchilada Mannheim\r\nReinfeiern von 14 auf 15.03.2015\r\nim Vorfeld 15 Tage - 15 Euro\r\n23.02. bis 12.03.14\r\nkleiner VIP-Empfang\r\nerst Live-Musik dann DJ ab 23 Uhr\r\nMaskottchen\r\nGetränkespecials\r\nGeburtstagskuchen um Mitternacht\r\n\r\nInnenstadt: Promo mit Gutscheinen für den Abend','2014-04-14 16:29:58',NULL,NULL,NULL,NULL,0,11),(23,33,'Hochzeitsmesse\r\nEintritt frei\r\nStandteilnehmer: 100 Euro Miete für die Standfläche\r\nKonzept erarbeiten (wer teilnimmt etc.)\r\nOktober 2014','2014-04-15 10:03:18',NULL,NULL,NULL,NULL,0,11),(24,10,'Culinario\r\nMarkt\r\nMainpost\r\nPost e. V.\r\nElferatmagazin\r\nMüller Verlag\r\nTonight\r\nWürzburg spezial\r\nFunkhaus\r\nTop Magazin\r\nFrizz\r\nTV Touring\r\nLohnenwert Magazin','2014-04-19 16:27:33',NULL,NULL,NULL,NULL,0,11),(25,22,'Wie kommen wir an die Reisebüros??\r\nIn ein paar kann ich gehen.\r\nHast du ein Kontakt zu den großen oder ist es hier besser in die Reisebüros persönlich rein zu gehen??','2014-04-20 13:15:54',NULL,NULL,NULL,NULL,0,11),(26,22,'laufende Kooperationen:\r\nNASPA','2014-04-20 14:09:22',NULL,NULL,NULL,NULL,0,11),(27,19,'Veroeffentlichungen:\r\nVeranstaltungen sind ab sofort unter folgenden Links einsehbar: http://prinz.de/stuttgart/events/411553-muttertag/2014-05-11, http://prinz.de/stuttgart/events/411554-vatertag/2014-05-29','2014-04-27 14:28:05',NULL,NULL,NULL,NULL,0,11),(28,22,'Magaritas of the Week\r\n05.05.2014	Pineapple-Cocos-Margarita\r\n12.05.2014	Strawberry-Chili-Margarita\r\n19.05.2014	Pear-Cinnamon-Margarita\r\n26.05.2014	Raspberry-Margarita\r\n02.06.2014	Blueberry-Vanilla-Margarita\r\n09.06.2014	Tropical-Margarita\r\n16.06.2014	Banana-Apple-Margarita\r\n23.06.2014	Deep-Blue-Sea-Margarita\r\n30.06.2014	Strawberry-Banana-Margarita\r\n07.07.2014	Melon-Margarita','2014-04-28 04:57:47',NULL,NULL,NULL,NULL,0,11),(30,30,'Veröffentlichung MAZ-Verlag\r\n\r\nHallo Herr Sieber,\r\nanbei das PDF unserer Enchilada-Sonderseite. \r\n\r\nBeste Grüße\r\nMarkus Becker\r\nRedakteur\r\n\r\nMAZ Verlag GmbH	\r\nAm Urnenfeld 12	\r\n35396 Gießen	\r\nTel: 	+49 (641) 9504 3491	\r\nE-Mail: 	mbecker@maz-verlag.de\r\n\r\nInternet: 	www.maz-verl